import { Chip , Stack , Typography} from '@mui/material';

function Resultados() {
    const [result, setResult] = useState({Lentes:{esquerda: "", direita:""}});
    return(
        <Stack direction="row" spacing={1}>
            <Chip label={Lentes.esquerda} color="primary" />
            <Chip label={Lentes.direita} color="success" />
        </Stack>
    );
}

export default Resultados;
